import Product from './Product';

function App() {

  let products;

  fetch('http://localhost:8000/products').then(res => res.json()).then((result) => {
    console.log('here')  
    console.log(result[0])

    products = []
    for(let i=0; i < result.length; i++) {
      product = result[i];
      products.append(<Product className='product' face={product.face} size={product.size} date={product.date} price={product.price}/>)
    }

    return (
      <div className='App'>
        <header>
            <h1>Products Grid</h1>

            <p>But first, a word from our sponsors:</p>
            <img
              className='ad'
              src={`http://localhost:8000/ads/?r=${Math.floor(Math.random()*1000)}`}
              alt='ad'/>
        </header>

        products goes here..
        <div id='productGrid'>
          <div className='row'>
            <Product className='product' face='._.' size='10px' date='5/23/2022' price='$5.21'/>
          </div>
        </div>
      </div>
    );

  }).catch((error) => {
    console.log(error)
  })

  console.log("HERE!!" + products)


}

export default App;
